How to determine count of distinct values of a field in mongoDB<p>I have a collection called INFODOCS which has a field called PROCESSOR_ID and STATUS(True/False/Null).
I want to determine two things</p>
<ol>
<li>Working_Processor = Count of Distinct PROCESSOR_ID where STATUS in not Null</li>
<li>Total_Processor = Count of Distinct PROCESSOR_ID</li>
</ol>
<p>INFODOCS</p>
<pre><code>[
  {
    &quot;_id&quot;: &quot;1&quot;,,
    &quot;PROCESSOR_ID&quot; : &quot;11&quot;,
    &quot;STATUS&quot; : &quot;True&quot;
  },
  {
    &quot;_id&quot;: &quot;2&quot;,
    &quot;PROCESSOR_ID&quot; : &quot;11&quot;,
    &quot;STATUS&quot; : &quot;&quot;
  },
  {
    &quot;_id&quot;: &quot;3&quot;,
    &quot;PROCESSOR_ID&quot; : &quot;22&quot;,
    &quot;STATUS&quot; : &quot;False&quot;
  },
  {
    &quot;_id&quot;: &quot;4&quot;,
    &quot;PROCESSOR_ID&quot; : &quot;33&quot;,
    &quot;STATUS&quot; : &quot;&quot;
  }
]
</code></pre>
<p>Here expected answer is:
Working_Processor = 2 (_id:1 and _id:3)
Total_Processor = 3</p>
<p>I tried using $addToSet with $cond, but want to know if there is better way of achieving the same.</p>
<pre><code>[
    {
        '$group': {
            '_id': None, 
            'WORKING_PROCESSOR': {
                '$addToSet': {
                    '$cond': [
                        {
                            '$ne': [
                                '$STATUS', ''
                            ]
                        }, '$PROCESSOR_ID', None
                    ]
                }
            }, 
            'TOTAL_PROCESSOR': {
                '$addToSet': '$PROCESSOR_ID'
            }
        }
    }, {
        '$project': {
            '_id': 0, 
            'WORKING_PROCESSOR': {
                '$subtract': [
                    {
                        '$size': '$WORKING_PROCESSOR'
                    }, 1
                ]
            }, 
            'TOTAL_PROCESSOR': {
                '$size': '$TOTAL_PROCESSOR'
            }
        }
    }
]
</code></pre>

